- proto: Paper
  entities:
  - uid: 4044
    components:
    - type: MetaData
      name: помятая бумажка
    - type: Transform
      pos: -20.81051,-9.862531
      parent: 1
    - type: Paper
      content: >-
        Они куда-то девают трупы, нет не на биомассу, они несут их в центральную сферу...


        Мои коллеги странно себя ведут, их поведение сильно изменилось.


        Я видел клона себя, но ЭТОГО НЕ МОЖЕТ БЫТЬ! ДУША ТОЛЬКО ОДНА... Самое ужасное, что ОН видел меня, ОН так ехидно улыбался глядя на меня, мне очень страшно.


        МОЙ КОЛЛЕГА, ОН ОН МОНСТР, по среди смены он вдруг обратился в нечто ужасное и напал на остальных, одним движением он обезглавил двоих... Я я бежал, что мне остаётся ещё делать?! Но я заперт на этом чёртовом бублике


        Я нашёл укрытие, тут есть вода и еда, но я слышу ИХ вой, я слышал МОЙ голос, мой клон искал меня, я стараюсь не издавать лишних звуков.


        Они нашли моё укрытие и заперли тут меня, еда и вода на исходе, хотя думаю, что раньше этого задохнусь без воздуха. 


        Если вы найдёте это сообщение, то бегите! и... передайте моим родным мои, что я их очень люблю
